metric_cfgs.tcl:
set_metric -name flow.machine.os -value "$::tcl_platform(os) $::tcl_platform(osVersion)"
if {$::tcl_platform(os) != "Linux"} {return [info hostname]}
if {[file isfile /proc/cpuinfo]} { 
  set if [open "/proc/cpuinfo" r]
  set cpus 0
  while {![eof $if]} {
    gets $if line
    set metric [string trim [lindex [split $line :] 0]]
    set full_value [lindex [split $line :] 1]
    set value [lindex [string trim [lindex [split $line ":"] 1]] 0]
    set unit [lindex [string trim [lindex [split $line ":"] 1]] 1]
    switch -- "$metric" {
      "cpu MHz"    { set_metric -name flow.machine.cpu.frequency -value "$value Mhz" }
      "cpu GHz"    { set_metric -name flow.machine.cpu.frequency -value "$value Ghz" }
      "model name" { set_metric -name flow.machine.cpu.model -value "$full_value" }
    }
    if {$metric == "processor"} {incr cpus}
  }
  close $if
  set_metric -name flow.machine.cpu.number -value $cpus
}
set mem_id [open "/proc/meminfo" r]
while {![eof $mem_id]} {
  gets $mem_id line
  set metric [string trim [lindex [split $line :] 0]]
  set value [lindex [string trim [lindex [split $line ":"] 1]] 0]
  set unit [lindex [string trim [lindex [split $line ":"] 1]] 1]
  switch -- "$metric" {
    MemTotal  { set_metric -name flow.machine.memory.total -value "$value $unit" }
    MemFree   { set_metric -name flow.machine.memory.free -value "$value $unit" }
    SwapTotal { set_metric -name flow.machine.swap.total -value "$value $unit" }
    SwapFree  { set_metric -name flow.machine.swap.free -value "$value $unit" }
  }
}
close $mem_id
return [info hostname]

