metric_cfgs.tcl:
set log_values {}
set my_eval eval
if {[info commands eval_legacy] ne ""} { set my_eval eval_legacy; }
# check that the procs exist
if {[$my_eval "namespace eval ::flowkit {info commands generic.get_msg_since_last_call}"] eq {}} {
  return {}
} else {
  if {![::um::userscript::is_common_ui_mode_available] && [info commands isLogCommand] ne ""} {
    foreach command "get_message report_message help" { dict set log_values $command [isLogCommand $command]}
    foreach {c v} $log_values { if {$v} {unlogCommand $c}}
  }
  # call the flowkit messages with out own var
  set return [$my_eval "::flowkit::generic.get_msg_since_last_call ::um::userscript::metric_last_message"]
  if {![::um::userscript::is_common_ui_mode_available]} {foreach {c v} $log_values { if {$v} {logCommand $c}}}
  return $return
}

metric_cfgs.inheritance_tcl:
# add the counts together of the similar messages
# format is: [list {count 1 id IMPDBTCL-247 ... }]
set parent_dict {}
foreach c $children {
  foreach e $c {
    if {$e ne {}} {
      if {[dict exists $parent_dict [dict get $e "id"]]} {
        dict set parent_dict [dict get $e "id"] "count"  [expr [dict get $parent_dict [dict get $e "id"] "count"]  + [dict get $e "count"]]
      } else {
        dict set parent_dict [dict get $e "id"] $e
      }
    }
  }
}
return [dict values $parent_dict]

